import React from "react";
import Link from "next/link";
import Router from "next/router";

const index = () => {
  return (
    <div>
      <h1>The Main Page</h1>
      <p>
        Go to
        <Link href="/auth">
          <a>Auth</a>
        </Link>
        Page
      </p>
      <button
        onClick={() => {
          Router.push("/auth");
        }}
      >
        Auth Route
      </button>
    </div>
  );
};
export default index;
